lection"},{"attributes":{"source":{"id":"6630"}},"id":"6634","type":"CDSView"},{"attributes":{"label":{"value":"60% do valor Normal"},"renderers":[{"id":"6663"}]},"id":"6691","type":"LegendItem"},{"attributes":{},"id":"7685","type":"DatetimeTickFormatter"},{"attributes":{"label":{"value":"70% do valor Normal"},"renderers":[{"id":"6633"}]},"id":"6659","type":"LegendItem"},{"attributes":{"text":"As predi\u00e7\u00f5es apresentadas s\u00e3o realizadas com base em um modelo ARX (Auto-Regressivo com entradas eX\u00f3genas) em que as entradas s\u00e3o os dados do google mobility (percentagem de pessoas nas resid\u00eancias) atrasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"7651","type":"Paragraph"},{"attributes":{},"id":"7703","type":"DatetimeTickFormatter"},{"attributes":{},"id":"6657","type":"UnionRenderers"},{"attributes":{},"id":"7785","type":"UnionRenderers"},{"attributes":{},"id":"7786","type":"Selection"},{"attributes":{},"id":"6658","type":"Selection"},{"attributes":{},"id":"7760","type":"UnionRenderers"},{"attributes":{"text":"&lt;select onchange=\"location = this.value;\"&gt;&lt;option&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;opt
